import React from 'react'
import ToDoItem from "./to-do-item";


const ToDoList = (props) =>{
    return (
        <ul >
            <ToDoItem className="completed"/>
            <ToDoItem className="editing"/>
            <ToDoItem />
            <ToDoItem />
        </ul>

    );
}

export default ToDoList;
